short ballcolour[4] = {0x07FF,0xFFC0,0x07E0,0x07FF};

// Structure to store square information
typedef struct {
    int x, y;
    int time;   // Position of the square
} Square;

Square squares[MAX_SQUARES]; // Array to store squares

// Structure to represent a circle
typedef struct
{
    int x, y;   // Center of the circle
    int dy;     // Velocity of the circle upwards
    short color; // Color of the circle
} Circle;

Circle circle[MAX_CIRCLE]; // Circle object

void move_circle(){
      for(int i =0 ;i < 10000; i ++);
      int touch = 0;
      int ind = 0;
      for(int i = 0 ; i < circle_count; i ++){
         // Erase the old circle
        draw_circle(circle[i].x, circle[i].y, CIRCLE_RADIUS, 0); // Draw with background color to erase
        // Update the circle's position
        circle[i].y += circle[i].dy;
        
        if(circle[i].y - CIRCLE_RADIUS == 0){
            touch ++;
            ind = i;
            continue;
        }
  
        // Draw the new circle
        draw_circle(circle[i].x, circle[i].y, CIRCLE_RADIUS, circle[i].color);
      }

      if(touch){
        for(int i = ind; i < circle_count-1; i ++){
            circle[i] = circle[i+1];
        }
        circle_count--;
      }
      
}

void display_score()
{
	int digit_values[10] = { 0x3F, 0x06, 0x5B, 0x4F, 0x66, 0x6D, 0x7D, 0x07, 0x7F, 0x6F};
	int ones = Score % 10; // Extract the ones digit
    int tens = (Score / 10) % 10; // Extract the tens digit
    int hundreds = (Score / 100) % 10; // Extract the hundreds digit

    // Set the values of the individual digits on the 7-segment displays
    *hex3_hex0_ptr =  (digit_values[hundreds] << 16) | (digit_values[tens] << 8) | digit_values[ones];
}

void generate_ball(){
     // Initialize circle
    for(int i =0 ; i < circle_count; i ++){
        if(circle[i].x == cannon_center_x){
           return;
        }
    }
    circle[circle_count].x = cannon_center_x;              // Center horizontally
    circle[circle_count].y = cannon_center_y - CIRCLE_RADIUS -  BASE_HEIGHT - CANNON_HEIGHT; // Start at the bottom
    circle[circle_count].dy = -1;                        // Velocity to move upwards
    int i = rand()%4;
    circle[circle_count].color = ballcolour[i];        // Random color
    circle_count++;
}

int collision(){
   int res = 0;
   for(int i = 0 ; i < circle_count; i ++){
    for(int j = 0 ; j < num_squares; j ++){
       if(abs(squares[j].x - circle[i].x) < 30 && abs(squares[j].y - circle[i].y) < 30){
        res = res + 1;
       }
    }
   }
   return res;
}


void play_game(){
   Score = 0;
   num_squares = 0;
   circle_count = 0;
   num_squareprev = 0;
   // change the screem colour to black
   clear_screen();
   
    int button_state; // Variable to store button state
   // Initial position of the cannon (centered at the bottom of the screen)
    cannon_center_x = VGA_WIDTH / 2;

    int res = 0;
    int ct = 240;

    // Store the initial center as the previous center
    prev_cannon_center_x = cannon_center_x;

    // Draw the new cannon
    draw_rectangle(cannon_center_x - (BASE_WIDTH / 2), cannon_center_y - BASE_HEIGHT, BASE_WIDTH, BASE_HEIGHT, 0xF800); // Red base
    draw_rectangle(cannon_center_x - (BARREL_WIDTH / 2), cannon_center_y - BASE_HEIGHT - CANNON_HEIGHT, BARREL_WIDTH, CANNON_HEIGHT, 0x7BEF); // Gray upper part

    // Draw random number of square boxes (between 1 and MAX_SQUARES)
        num_squares = rand() % (MAX_SQUARES + 1); // Random number between 1 and MAX_SQUARES
        if(num_squares == 0) num_squares ++;
        for (int i = 0; i < num_squares; i++)
        {
            // Random position for each square
            squares[i].x = rand() % (VGA_WIDTH - SQUARE_SIZE);
            squares[i].y = rand() % (VGA_HEIGHT - SQUARE_SIZE);
            squares[i].time = 300;
			if(squares[i].y > VGA_HEIGHT/2) squares[i].y -= VGA_HEIGHT/2;
            // Draw square box
            draw_square(squares[i].x, squares[i].y, SQUARE_SIZE);
        }

   for(int time = 0 ; time < 10000; time++){     
            
            display_score();

            if(squares[0].time == 0) 
            {
                // Erase the squares for the next frame
                for (int i = 0; i < num_squares; i++)
                {
                 clear_square(squares[i].x, squares[i].y, SQUARE_SIZE);
                }

                num_squares = rand() % (MAX_SQUARES + 1); // Random number between 1 and MAX_SQUARES
                if(num_squares == 0) num_squares ++;
                for (int i = 0; i < num_squares; i++)
                {
                  // Random position for each square
                  squares[i].x = rand() % (VGA_WIDTH - SQUARE_SIZE);
                  squares[i].y = rand() % (VGA_HEIGHT - SQUARE_SIZE);
                  squares[i].time = 300;
			      if(squares[i].y > VGA_HEIGHT/2) squares[i].y -= VGA_HEIGHT/2;
                  // Draw square box
                  draw_square(squares[i].x, squares[i].y, SQUARE_SIZE);
                }
            }
                
           button_state = *KEY_ptr;   // to check the button state
           // Check if left button is pressed
            if (button_state & 0x01)
           {
            // for(int j =0; j < 600000;j ++){}
            // Move cannon to the right
             cannon_center_x += 1;
            }
           // Check if right button is pressed
           else if (button_state & 0x02)
           {
            // for(int j =0; j < 600000;j ++){}
            // Move cannon to the left
            cannon_center_x -= 1;
           }
           else if(button_state & 0x04){ 
               for(int j =0; j < 600000;j ++){}
               generate_ball();
            }  // to generate a cannon ball
     
          if(prev_cannon_center_x != cannon_center_x){
            // Clear the previous cannon
           clear_rectangle(prev_cannon_center_x - (BASE_WIDTH / 2), prev_cannon_center_y - BASE_HEIGHT, BASE_WIDTH, BASE_HEIGHT);
           clear_rectangle(prev_cannon_center_x - (BARREL_WIDTH / 2), prev_cannon_center_y - BASE_HEIGHT - CANNON_HEIGHT, BARREL_WIDTH, CANNON_HEIGHT);

           // Draw the new cannon
           draw_rectangle(cannon_center_x - (BASE_WIDTH / 2), cannon_center_y - BASE_HEIGHT, BASE_WIDTH, BASE_HEIGHT, 0xF800); // Red base
           draw_rectangle(cannon_center_x - (BARREL_WIDTH / 2), cannon_center_y - BASE_HEIGHT - CANNON_HEIGHT, BARREL_WIDTH, CANNON_HEIGHT, 0x7BEF); // Gray upper part

           // Update previous center
           prev_cannon_center_x = cannon_center_x;
         
          }
           
           if(circle_count > 0){
              move_circle();  // check for movement of cannon ball
           } 

            res = collision();

             if(res > 0){
              write_pixel(0,ct,0xFFFF);
              Score += res;
              for(int i =0 ; i < circle_count; i ++){
                 draw_circle(circle[i].x, circle[i].y, CIRCLE_RADIUS, 0); // Draw with background color to erase
              }
              circle_count = 0;
              squares[0].time = 0;
              ct -= 20;
              
			  for(int i =0 ; i < 320; i ++){
                for(int j =0 ; j < 180; j ++){
                   write_pixel(i,j,0);
                }
              }
                 
              for(int i =0 ; i < 320; i ++){
                for(int j =0 ; j < 180; j ++){
                   write_pixel(i,j,scored[i][j]);
                }
              }

              for(int i =0 ; i < 10000000; i ++){;}
              
              for(int i =0 ; i < 320; i ++){
                for(int j =0 ; j < 180; j ++){
                   write_pixel(i,j,0);
                }
              }

              continue;
            }
           
           for(int i =0 ; i < 100000; i ++){;}

            squares[0].time -= 1;
        }

}



